import "bootstrap/dist/css/bootstrap.css";
import React, { useState } from "react";
import "../ExamMaster/Createexam.css";
function Createexam() {


  function handlevalues(){
    const examId=document.getElementById('examid').value;
    console.log(examId);
    const examname=document.getElementById('examname').value;
    console.log(examname);
    const description=document.getElementById('description').value;
    console.log(description);
    const creationdate=document.getElementById('creationdate').value;
    console.log(creationdate);
    const expirationdate=document.getElementById('expirationdate').value;
    console.log(expirationdate);
    const noofquestions=document.getElementById('noofquestions').value;
    console.log(noofquestions);
    const durationminutes=document.getElementById('durationminutes').value;
    console.log(durationminutes);
    const passpercentage=document.getElementById('passpercentage').value;
    console.log(passpercentage);
    const questionsrandomized=document.getElementById('questionsrandomized').value;
    console.log(questionsrandomized);
    const answersmust=document.getElementById('answersmust').value;
    console.log(answersmust);
    const enablenegativemark=document.getElementById('enablenegativemark').value;
    console.log(enablenegativemark);
    const negativemarkvalue=document.getElementById('negativemarkvalue').value;
    console.log(negativemarkvalue);

  }
  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = new FormData(e.target);
    console.log(e);
    console.log(e.target);
    const examId = data.get("examId");
    console.log("examId-----", examId);
    const examName = data.get("examName");
    const description = data.get("description");
    const creationDate = data.get("creationDate");
    const expirationDate = data.get("expirationDate");
    const noOfQuestions = data.get("noOfQuestions");
    const durationMinutes = data.get("durationMinutes");
    const passPercentage = data.get("passPercentage");
    const questionsRandomized = data.get("questionsRandomized");
    const answersMust = data.get("answersMust");
    const enableNegativeMark = data.get("enableNegativeMark");
    const negativeMarkValue = data.get("negativeMarkValue");

    const myobject = Object.fromEntries(data.entries());
    Object.entries(myobject).map(([key, value], keyIndex) => {
      validateformexammaster(key, value);
    });


    function validateformexammaster(key,value){

      switch(key){
        case "examId" : {

          if(value=="" || value==null){
              alert("examId should not be em")
          }
        }
      }

    }

    const map = {
      examId: examId,
      examName: examName,
      description: description,
      creationDate: creationDate,
      expirationDate: expirationDate,
      noOfQuestions: noOfQuestions,
      durationMinutes: durationMinutes,
      passPercentage: passPercentage,
      questionsRandomized: questionsRandomized,
      answersMust: answersMust,
      enableNegativeMark: enableNegativeMark,
      negativeMarkValue: negativeMarkValue,
    };
    console.log(map);
  //   fetch("https://localhost:8443/onlineexam/control/ExamMasterEvent", {
  //     method: "POST",
  //     body: JSON.stringify(map),
  //     headers: {
  //       "Content-Type": "application/json",
  //       Accept: "application/json",
  //     },
  //   })
  //     .then((response) => alert("Value added succesfully"))
  //     .catch((err) => console.log("ERROR FROM FETCH", err));
 };

  return (
    <>
      <div className="row">
        <div className="col-2"></div>
        <div className="col-8">
          <form onSubmit={handleSubmit}>
            <div className="form-group mt-3">
              <label for="" className="form-label">
                ExamId
              </label>
              <input
                type="text"
                id="examid"
                className="form-control  w-50 "
                placeholder="ExamId eg(1)"
                name="examId"
              />
            </div>
            <div className="form-group mt-3">
              <label for="" className="form-label ">
                Examname
              </label>
              <input
                type="text"
                id="examname"
                className="form-control  w-50"
                placeholder="Examname"
                name="examName"
              />
            </div>
            <div className="form-group mt-3">
              <label for="" className="form-label ">
                Description
              </label>
              <input
                type="text"
                id="description"
                className="form-control   w-50"
                placeholder="Description "
                name="description"
              />
            </div>

            <div className="form-group mt-3">
              <label for="" className="form-label ">
                Creationdate
              </label>
              <input
                type="date"
                id="creationdate"
                className="form-control  w-50"
                name="creationDate"
              />
            </div>

            <div className="form-group mt-3">
              <label for="" className="form-label ">
                Expirationdate
              </label>
              <input
                type="date"
                id="expirationdate"
                className="form-control  w-50"
                name="expirationDate"
              />
            </div>
            <div className="form-group mt-3">
              <label for="" className="form-label ">
                NoOfQuestions
              </label>
              <input
                type="text"
                id="noofquestions"
                className="form-control   w-50"
                placeholder="No of questions"
                name="noOfQuestions"
              />
            </div>

            <div className="form-group mt-3">
              <label for="" className="form-label ">
                Durationminutes
              </label>
              <input
                type="text"
                id="durationminutes"
                placeholder="Duration Minutes eg(60-Minutes)"
                name="durationMinutes"
                className="form-control  w-50"
              />
            </div>
            <div className="form-group mt-3">
              <label for="" className="form-label ">
                Passpercentage
              </label>
              <input
                type="text"
                id="passpercentage"
                placeholder="pass-percentage eg(25%)"
                name="passPercentage"
                className="form-control   w-50"
              />
            </div>
            <div className="form-group mt-3">
              <label for="" className="form-label ">
                QuestionsRandomized
              </label>
              <input
                type="text"
                name="questionsRandomized"
                className="form-control   w-50"
                id="questionsrandomized"
                placeholder="questions randomized eg(Yes or No)"
              />
            </div>
            <div className="form-group mt-3">
              <label for="" className="form-label">
                Answersmust
              </label>
              <input
                type="text"
                name="answersMust"
                placeholder="To Answer is must eg(Y OR N)"
                id="answersmust"
                className="form-control   w-50"
              />
              {/* <select name="" type="dropdown" id=""></select> */}
            </div>
            <div className="form-group mt-3">
              <label for="" className="form-label">
                Enablenegativemark
              </label>
              <input
                type="text"
                name="enableNegativeMark"
                placeholder="Enablenegativemark eg(Y OR N)"
                id="enablenegativemark"
                className="form-control w-50"
              />
            </div>
            <div className="form-group mt-3">
              <label for="" className="form-label">
                NegativeMarkvalue
              </label>
              <input
                type="text"
                placeholder="Negativemarkvalue eg(0.25)"
                id="negativemarkvalue"
                name="negativeMarkValue"
                className="form-control  w-50"
              />
            </div>

            <button type="submit" className="btn btn-primary mt-4">
              Submit
            </button>
          </form>
        </div>

        <div className="col-2"></div>
      </div>
    </>
  );
}

export default Createexam;
